import  './footer.scss';



function Footer() {

    return(
        <div id="footer">
            <h1>Contato</h1>
            <p> Nathalia Vieira - Curso CTD 2021 </p>
            <a class="contato" href="https://github.com/nathsilvavieira">Linkedin</a> 
            <a class="contato" href="https://www.linkedin.com/in/nathalia-vieira93/">Github</a> 
            <span class="contato">naahviera@gmail.com</span>

        </div>
    )
}

export default Footer;
